import React from 'react'

import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
const Index = (props) => {
    return <Button onClick={props.onClick} disabled={props.disabled ? "disabled" : ""} variant="contained" color="primary" style={{ "backgroundColor": "green" }} className={props.className}>{props.text}</Button>
}

export default Index;
